INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 102301, "2020/07/31 12:00:00", 24, 0.0, 24001, 401, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2030/12/17 14:59:59", 0.0, 2, 10046, "アヤネ", 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 102301, "2020/07/31 12:00:00", 24, 2.21, 24002, 402, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2030/12/17 14:59:59", 0.0, 2, 10046, "アヤネ", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 102301, "2020/07/31 12:00:00", 24, 0.0, 24003, 403, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2030/12/17 14:59:59", 0.0, 2, 10046, "アヤネ", 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192201, "2020/07/31 12:00:00", 24, 1.99, 24004, 701, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2030/12/17 14:59:59", 0.0, 1, 10046, "アサヒ", 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192201, "2020/07/31 12:00:00", 24, 2.21, 24005, 702, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2030/12/17 14:59:59", 0.0, 2, 10046, "アサヒ", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192201, "2020/07/31 12:00:00", 24, 3.33, 24006, 703, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2030/12/17 14:59:59", 0.0, 1, 10046, "アサヒ", 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192301, "2020/07/31 12:00:00", 24, 0.0, 24007, 801, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2030/12/17 14:59:59", 0.0, 2, 10046, "部員３", 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192301, "2020/07/31 12:00:00", 24, 2.68, 24008, 802, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2030/12/17 14:59:59", 0.0, 2, 10046, "部員３", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192301, "2020/07/31 12:00:00", 24, 0.0, 24009, 803, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2030/12/17 14:59:59", 0.0, 2, 10046, "部員３", 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192501, "2020/07/31 12:00:00", 24, 0.0, 24010, 501, "やった！", "2030/12/17 14:59:59", 0.0, 1, 10046, "", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192501, "2020/07/31 12:00:00", 24, 0.0, 24011, 502, "勝ったよ！", "2030/12/17 14:59:59", 0.0, 1, 10046, "", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192501, "2020/07/31 12:00:00", 24, 0.0, 24012, 503, "いい調子！", "2030/12/17 14:59:59", 0.0, 1, 10046, "", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 113501, "2020/07/31 12:00:00", 24, 5.33, 24013, 111, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2030/12/17 14:59:59", 0.0, 2, 10046, "ミサト", 6);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 113501, "2020/07/31 12:00:00", 24, 6.85, 24014, 112, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2030/12/17 14:59:59", 0.0, 2, 10046, "ミサト", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 113501, "2020/07/31 12:00:00", 24, 3.0, 24015, 113, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2030/12/17 14:59:59", 0.0, 2, 10046, "ミサト", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192401, "2020/07/31 12:00:00", 24, 6.11, 24016, 611, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2030/12/17 14:59:59", 0.0, 2, 10046, "ダイチ", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192401, "2020/07/31 12:00:00", 24, 6.75, 24017, 612, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2030/12/17 14:59:59", 0.0, 2, 10046, "ダイチ", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192401, "2020/07/31 12:00:00", 24, 0.0, 24018, 613, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2030/12/17 14:59:59", 0.0, 2, 10046, "ダイチ", 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 113401, "2020/07/31 12:00:00", 24, 4.52, 24019, 211, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2030/12/17 14:59:59", 0.0, 1, 10046, "ハツネ", 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 113401, "2020/07/31 12:00:00", 24, 3.89, 24020, 212, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2030/12/17 14:59:59", 0.0, 1, 10046, "ハツネ", 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 113401, "2020/07/31 12:00:00", 24, 13.49, 24021, 213, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2030/12/17 14:59:59", 0.0, 2, 10046, "ハツネ", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 106501, "2020/07/31 12:00:00", 24, 3.17, 24022, 311, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2030/12/17 14:59:59", 0.0, 2, 10046, "カヤ", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 106501, "2020/07/31 12:00:00", 24, 4.42, 24023, 312, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2030/12/17 14:59:59", 0.0, 2, 10046, "カヤ", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 106501, "2020/07/31 12:00:00", 24, 2.89, 24024, 313, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "2030/12/17 14:59:59", 0.0, 1, 10046, "カヤ", 6);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 102301, "2020/07/31 12:00:00", 24, 3.71, 24025, 421, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "2030/12/17 14:59:59", 0.0, 3, 10046, "アヤネ", 4);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192201, "2020/07/31 12:00:00", 24, 5.1, 24026, 721, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "2030/12/17 14:59:59", 0.0, 1, 10046, "アサヒ", 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192301, "2020/07/31 12:00:00", 24, 4.34, 24027, 821, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "2030/12/17 14:59:59", 0.0, 3, 10046, "部員３", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, 192501, "2020/07/31 12:00:00", 24, 0.0, 24028, 521, "いい勝負だったよ\nまたやろうね", "2030/12/17 14:59:59", 0.0, 1, 10046, "", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (-360.0, 113501, "2020/07/31 12:00:00", 24, 5.62, 24029, 101, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "2030/12/17 14:59:59", 0.0, 2, 10046, "ミサト", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (-360.0, 113501, "2020/07/31 12:00:00", 24, 9.58, 24030, 102, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "2030/12/17 14:59:59", 0.0, 2, 10046, "ミサト", 1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (-360.0, 113501, "2020/07/31 12:00:00", 24, 0.0, 24031, 103, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "2030/12/17 14:59:59", 0.0, 2, 10046, "ミサト", 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (-360.0, 113501, "2020/07/31 12:00:00", 24, 9.13, 24032, 104, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "2030/12/17 14:59:59", 0.0, 1, 10046, "ミサト", 2);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (-360.0, 113501, "2020/07/31 12:00:00", 24, 8.27, 24033, 105, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "2030/12/17 14:59:59", 0.0, 2, 10046, "ミサト", 1);
